import React from 'react'
import { DataGrid } from '@material-ui/data-grid';
import Avatar from '@material-ui/core/Avatar';
import './userList.css'

export default function UserList() {

    const columns = [
        { 
            field: 'id', 
            headerName: 'ID', 
            width: 90 
        },
        {
          field: 'usuario',
          headerName: 'Nombre Usuario',
          width: 200,
          editable: true,
        },
        {
          field: 'avatar',
          headerName: 'Avatar',
          width: 200,
          renderCell: (params) => {
              return(
                  <div className='userListUser'>
                      <img src={params.row.avatar} alt=''/>
                  </div>
              )
          }
        },
        {
          field: 'correo',
          headerName: 'Correo',
          width: 200,
          editable: true,
        },
        {
            field: 'rut',
            headerName: 'Rut',
            width: 110,
            editable: true,
          },
          {
            field: 'status',
            headerName: 'Status',
            width: 110,
            editable: true,
          }
      ];

      const rows = [
        { id: 1, usuario: 'Snow', avatar: 'https://ibb.co/cDvpSjn', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo'  },
        { id: 2, usuario: 'Lannister', avatar: '', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },
        { id: 3, usuario: 'Lannister', avatar: '', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },
        { id: 4, usuario: 'Stark', avatar: '', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },
        { id: 5, usuario: 'Targaryen', avatar: '', correo: 'alelias@gmail.com', rut: '23.342.223-4', status: 'activo' },
      ];


    return (
        <div className='userList'>
            <DataGrid
                rows={rows}
                columns={columns}
                pageSize={5}
                checkboxSelection
            />
        </div>
    )
}
